    let private search (v : 'a) (data : 'a[]) =
        let mutable l = 0
        let mutable r = data.Length - 1
        while l <= r do
            let m = (l + r) / 2
            let vm = data.[m]
            let c = compare v vm
            if c > 0 then
                l <- m + 1
            elif c < 0 then
                r <- m - 1
            else
                l <- m + 1
                r <- m
        r, l

    let private fds = ds |> Array.map float
    let private dsl = ds.Length
    let private dsl2 = ds.Length * ds.Length

    let invCDF (d1 : float) (d2 : float) (p : float) =
        let a0, a1 = search d1 fds
        let b0, b1 = search d2 fds
        let p0, p1 = search p ps

        let a0 = clamp 0 (ds.Length - 1) a0
        let b0 = clamp 0 (ds.Length - 1) b0
        let p0 = clamp 0 (ps.Length - 1) p0

        let a1 = clamp 0 (ds.Length - 1) a1
        let b1 = clamp 0 (ds.Length - 1) b1
        let p1 = clamp 0 (ps.Length - 1) p1

        let inline index (ai : int) (bi : int) (pi : int) =
            pi * dsl2 + ai * dsl + bi

        let v000 = invCDFTable.[index a0 b0 p0]
        let v001 = invCDFTable.[index a0 b0 p1]
        let v010 = invCDFTable.[index a0 b1 p0]
        let v011 = invCDFTable.[index a0 b1 p1]
        let v100 = invCDFTable.[index a1 b0 p0]
        let v101 = invCDFTable.[index a1 b0 p1]
        let v110 = invCDFTable.[index a1 b1 p0]
        let v111 = invCDFTable.[index a1 b1 p1]

        let ta = 
            let s = fds.[a1] - fds.[a0]
            if s <= 0.0 then 0.0
            else (d1 - fds.[a0]) / s
        //printfn "d1: (%d, %d): %A" ds.[a0] ds.[a1] ta
            
        let tb = 
            let s = fds.[b1] - fds.[b0]
            if s <= 0.0 then 0.0
            else (d2 - fds.[b0]) / s
        //printfn "d2: (%d, %d): %A" ds.[b0] ds.[b1] tb

        let tp =
            let s = ps.[p1] - ps.[p0]
            if s <= 0.0 then 0.0
            else (p - ps.[p0]) / s
        //printfn "p: (%f, %f): %A" ps.[p0] ps.[p1] tp


        let v00x = lerp v000 v001 tp
        let v01x = lerp v010 v011 tp
        let v10x = lerp v100 v101 tp
        let v11x = lerp v110 v111 tp

        let v0xx = lerp v00x v01x tb
        let v1xx = lerp v10x v11x tb

        let vxxx = lerp v0xx v1xx ta
        vxxx

type RegressionInfo3d =
    {
        Plane           : Plane3d
        PlaneToWorld    : Trafo3d
        Eigenvalues     : V3d
        AngularErrors   : V2d
        HyperbolicAxes  : V3d
    }

    member x.Center = x.PlaneToWorld.Forward.C3.XYZ
    member x.Normal = x.PlaneToWorld.Forward.C2.XYZ
    member x.Axis0 = x.PlaneToWorld.Forward.C0.XYZ
    member x.Axis1 = x.PlaneToWorld.Forward.C1.XYZ
    member x.Ellipsoid = 
        let e = Euclidean3d.FromTrafo3d(x.PlaneToWorld, 1E-8)
        Ellipsoid3d(e, x.Eigenvalues)

    member x.ToJson(?name : string, ?uid : string, ?points : seq<V3d>) =
        let center = x.Center

        let inline n v = Json.Number (decimal v)

        Json.Object (
            Map.ofList [
                match uid with
                | Some uid -> "uid", Json.String uid
                | _ -> ()
                match name with
                | Some name -> "name", Json.String name
                | _ -> ()

                "axes", Json.Array [
                    Json.Array [ n x.Axis0.X; n x.Axis0.Y; n x.Axis0.Z ]
                    Json.Array [ n x.Axis1.X; n x.Axis1.Y; n x.Axis1.Z ]
                    Json.Array [ n x.Normal.X; n x.Normal.Y; n x.Normal.Z ]
                ]

                "hyperbolic_axes", Json.Array [ 
                    n x.HyperbolicAxes.X; n x.HyperbolicAxes.Y; n x.HyperbolicAxes.Z 
                ]
                "max_angular_error", n (Constant.DegreesPerRadian * x.AngularErrors.Y)
                "min_angular_error", n (Constant.DegreesPerRadian * x.AngularErrors.X)
                "center", Json.Array [ n center.X; n center.Y; n center.Z]

                match points with
                | Some pts ->
                    "centered_array", Json.Array [
                        for p in pts do
                            let c = p - center
                            Json.Array [ n c.X; n c.Y; n c.Z ]
                    ]
                | None -> ()

            ]
        )


[<AutoOpen>]
module LinearRegressionExtensions =

    type LinearRegression3d with
        member x.TryGetRegressionInfo(?confidenceLevel : float, ?degreesOfFreedom : int) =
            if x.Count < 3 then
                None
            else
                let degreesOfFreedom = defaultArg degreesOfFreedom 2
                let confidenceLevel = defaultArg confidenceLevel 0.95

                match SVD.Decompose x.CovarianceMatrix with
                | Some (u, s, _vt) ->
                    let c = x.Centroid
                    let trafo =
                        Trafo3d(
                            M44d(
                                u.M00, u.M01, u.M02, c.X,
                                u.M10, u.M11, u.M12, c.Y,
                                u.M20, u.M21, u.M22, c.Z,
                                0.0, 0.0, 0.0, 1.0
                            ),
                            M44d(
                                u.M00, u.M10, u.M20, -Vec.dot u.C0 c,
                                u.M01, u.M11, u.M21, -Vec.dot u.C1 c,
                                u.M02, u.M12, u.M22, -Vec.dot u.C2 c,
                                0.0, 0.0, 0.0, 1.0
                            )
                        )

                    let ev = s.Diagonal
                    let measurementNoise = ev.Z / (float (x.Count - degreesOfFreedom))
                    let noiseCov = 4.0 * ev * measurementNoise
                    let inline fppf (x : float) (d1 : int) (d2 : int) =
                        FDistr.invCDF (float d1) (float d2) x

                    let inline fisherStatistic (n : int) (confidence : float) (dof : int) : float =
                        fppf confidence dof (n - dof)
                    
                    let inline applyErrorScaling (nominal : V3d) (err : V3d) (n : int) : V3d =
                        nominal * V3d.PPN - err |> abs


                    let z = fisherStatistic x.Count confidenceLevel degreesOfFreedom
                    let err = z * sqrt noiseCov
                    
                    let hyp = applyErrorScaling ev err x.Count
                    let n = hyp |> sqrt
                    let angles = 
                        V2d(
                            atan2 n.Z n.X,
                            atan2 n.Z n.Y
                        ) 
                    Some {
                        Plane           = Plane3d(Vec.normalize trafo.Forward.C2.XYZ, trafo.Forward.C3.XYZ)
                        PlaneToWorld    = trafo
                        Eigenvalues     = ev
                        AngularErrors   = angles
                        HyperbolicAxes  = hyp
                    }
                | None ->
                    None

        member x.GetRegressionInfo() =
            match x.TryGetRegressionInfo() with
            | Some r -> r
            | None -> failwith "regression failed"

